import React from 'react';
import { GoogleMap, useLoadScript, Marker, InfoWindow } from '@react-google-maps/api';

const libraries = ["places"];
const mapContainerStyle = {
    width: '100vw',
    height: '60vh'
}

const center = {
    lat: 51.600118,
    lng: 5.226617
}

export default function Maps() {
    const {isLoaded, loadError} = useLoadScript({
        googleMapsApiKey: "AIzaSyAsjIFcS5UtxpAgk9VqboakwYPOuFXdh6U",
        libraries,
    });

    if(loadError) return "Error loading maps";
    if(!isLoaded) return "Loading maps";
    return(
        <div style={{color: 'white'}}>
            <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2478.246329630105!2d5.2241643160986975!3d51.60037497965048!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47c6eb49673cddab%3A0x342fe01c886f425e!2sAnytime%20Fitness!5e0!3m2!1snl!2snl!4v1610981791677!5m2!1snl!2snl" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>
        </div>
    )
}
